import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Layout from './components/Layout';
import ErrorBoundary from './components/ErrorBoundary';
import StateDistrictDepartmentSelector from './components/StateDistrictDepartmentSelector';
import TenderList from './components/TenderList';
import TenderDetails from './components/TenderDetails';
import PasswordReset from './components/PasswordReset';
import RequestOtp from './components/RequestOtp';
import VerifyOtp from './components/VerifyOtp';
import Login from './components/Login';
import Register from './components/Register';
import Subscriptions from './components/Subscriptions';
import Mission from './components/Mission';
import Services from './components/Services';
import CoreValues from './components/CoreValues';
import Reviews from './components/Reviews';
import PrivacyPolicy from './components/PrivacyPolicy';
import UploadDocuments from './components/UploadDocuments';
import ContactUs from './components/ContactUs';

function App() {
  return (
    <Router>
      <ErrorBoundary>
        <Layout>
          <nav>
            <ul>
              <li><Link to="/">Home</Link></li>
              <li><Link to="/tenders">Tenders</Link></li>
              <li><Link to="/login">Login</Link></li>
              <li><Link to="/register">Register</Link></li>
              <li><Link to="/subscriptions">Subscriptions</Link></li>
              <li><Link to="/mission">Mission</Link></li>
              <li><Link to="/services">Services</Link></li>
              <li><Link to="/core-values">Core Values</Link></li>
              <li><Link to="/reviews">Reviews</Link></li>
              <li><Link to="/privacy-policy">Privacy Policy</Link></li>
              <li><Link to="/upload-documents">Upload Documents</Link></li>
              <li><Link to="/contact-us">Contact Us</Link></li>
            </ul>
          </nav>
          <Switch>
            <Route path="/tenders/list" component={TenderList} />
            <Route path="/tenders/:id" component={TenderDetails} />
            <Route path="/password-reset/new-password" component={PasswordReset} />
            <Route path="/password-reset/request-otp" component={RequestOtp} />
            <Route path="/password-reset/verify-otp" component={VerifyOtp} />
            <Route path="/login" component={Login} />
            <Route path="/register" component={Register} />
            <Route path="/subscriptions" component={Subscriptions} />
            <Route path="/mission" component={Mission} />
            <Route path="/services" component={Services} />
            <Route path="/core-values" component={CoreValues} />
            <Route path="/reviews" component={Reviews} />
            <Route path="/privacy-policy" component={PrivacyPolicy} />
            <Route path="/upload-documents" component={UploadDocuments} />
            <Route path="/contact-us" component={ContactUs} />
            <Route path="/" component={StateDistrictDepartmentSelector} />
            {/* Add more routes as needed */}
          </Switch>
        </Layout>
      </ErrorBoundary>
    </Router>
  );
}

export default App;
